			"job_description": "Mobile React Native Developer. Remote. Contract 12 months, renewable.\n\nExpertise in React Native for iOS & Android development required.\n\n$65 to $88 per hour on W-2 only. NO CORP TO CORP.\n\nApplicants must be legally authorized to work in the U.S. without sponsorship. The Company is unable to sponsor or take over sponsorship of an employment visa.\n\nKey Responsibilities:\n• Development and maintenance of mobile applications according to the design to enable the venture’s success at each stage of the digital / App based product delivery (POC, Alpha, Beta, MVP, Scale-up).\n• Write high-quality, self-documenting code using test-driven development techniques.\n• Partner with product team, designers, operations and other stakeholders and be able to give/receive feedback and suggest trade-offs when required.\n• Ensure the code follows latest coding practices and best industry standards.\n• Work closely with backend developers to understand and properly use the systems APIs.\n• Write both unit and integration tests and develop automation tools for daily tasks.\n• Challenge ideas and opinions to avoid pitfalls and inefficient solutions.\n• Ensure quality of delivered milestones using proper unit testing and UI testing.\n• Troubleshoot and solve customer issues by applying debugging and testing.\n\nMinimum Educational Qualifications\n• Bachelor’s degree in computer science, Information Technology or similar field\n\nMinimum Experience\n• 5 years working in a fast paced mobile & web development team that involved active collaboration cross-functional digital teams and departments.\n• 3+ years of experience in React Native mobile development including contribution to design & architecture\n• Familiarity with collaborative and iterative software development workflow for mobile and web development.\n• Strong experience in building customer facing mobile and/or web applications according to the high standard for design.\n• Ability to write high-quality, self-documenting code using test-driven development techniques.\n• Ability to partner with UX designers including giving and receiving feedback and suggesting tradeoffs when required.\n• Strong knowledge and experience with best practices in software engineering including latest coding standards, CI/CD, unit testing, integration testing, security practices, design patterns and other industry standards.\n• Sound knowledge of system API’s and backend integrations.\n• Ability to work closely with backend developers to properly integrate with backend systems to build a scalable, customer facing, fault tolerant 3-tier application.\n• Ability to challenge ideas and opinions to avoid pitfalls and inefficient solutions.\n• Strong knowledge of cross-platform development including iOS and Andriod.\n• Familiarity with testing and debugging processes, including unit testing and UI testing.\n• Strong interpersonal communication and collaboration skills and able to work well with geographically distributed cross-functional teams.\n\nTechnical Skillset required:\n\no React & React Native (must have expertise)\n\no iOS and Android Development (must have expertise)\n\no Hands-on experience with app store releases\n\no Knowledge and experience with Rest API\n\no Python or any other backend experience is a plus.\n\no Development experience in AWS environment\n\no RDMS & NoSQL (MySQL is a plus)\n\no Agile Development methodologies (including CI/CD, scrum practices, test driven development)\n\no Familiarity with cloud infrastructure, containerization, security practices, business and technical metrics\n\no Familiarity with Logging & analytical tools\n\no Familiarity with open source, 3rd party and cross-platform integrations.\n\nJob Type: Contract",
