			"job_description": "The Road to a Great Career Starts with Saia!\n\nWhen it began in 1924, Saia (NASDAQ: SAIA) covered a two-state area: Louisiana and Texas. Today, Saia is one of the most successful carriers in the United States, providing regional and interregional LTL, non-asset truckload service, and third-party logistics. Headquartered in Johns Creek, GA, Saia is a growing corporation offering the best-in-class benefits and opportunities to inspire every member of our team. With over 14,000 employees dedicated to their jobs and our customers, you may discover your own career path at Saia.\n\nSupports and optimizes the sales process within the organization. Provides internal sales training and streamlines the end-to-end sales process.\n\nMajor Tasks and Responsibilities\n• Facilitates comprehensive educational courses maximizing performance for the sales operations team.\n• Assesses employees’ sales skills and business processes to identify areas of improvement.\n• Collaborates with the sales operations team to design, develop, and execute targeted sales enablement strategies.\n• Develops a systematic approach for organizing and distributing sales enablement content.\n• Implements strategies and programs to improve the quality and quantity of sales.\n• Monitors and measures sales enablement metrics to provide efficient sales support.\n• Interprets and analyzes sales-driven data to improve employees’ performance.\n• Creates data-driven action plans to enable stronger sales practices.\n\nPreferred Qualifications\n• Bachelor’s degree in business or a related field.\n• 2+ years of training, sales, and transportation experience.\n• Proficiency in Microsoft Office.\n• Ability to travel as needed.\n\nToday, Saia's network of 195 terminals covers 44 states in the U.S. as well as Canada. Through our network of partners, we serve the balance of the U.S. including Alaska and Hawaii, plus Puerto Rico and Mexico. Through our three operating service groups - Saia LTL, LinkEx, and Saia Logistics Services - we provide complete transportation and logistics solutions. As a company, Saia is dedicated to providing every employee the opportunity and environment to continue to grow and contribute, individually and as part of a team.",
